import React from 'react';
import { Link } from 'react-router-dom';

function Banner() {
  return (
    <div className="flex flex-col items-center bg-gray-100">
      <nav className="flex space-x-4 py-4 bg-white shadow-md w-full justify-center">
        <Link to="/" className="text-gray-700 hover:text-blue-500 transition duration-200">Home</Link>
        <Link to="/login" className="text-gray-700 hover:text-blue-500 transition duration-200">Login/Signup</Link>
        <Link to="/seller" className="text-gray-700 hover:text-blue-500 transition duration-200">Become a Seller</Link>
        <Link to="/about" className="text-gray-700 hover:text-blue-500 transition duration-200">About</Link>
        <Link to="/contact" className="text-gray-700 hover:text-blue-500 transition duration-200">Contact Us</Link>
      </nav>

      <div className="w-full">
        <img
          src="banner.jpg"
          alt="bannerimg"
          className="w-full h-64 object-cover opacity-90 transition duration-200 hover:opacity-100"
        />
      </div>
    </div>
  );
}

export default Banner;
